    false,nt"url": null,nt"notes": "This map layer shows point locations of
    costly individual landslide events in the 50 United States and Puerto Rico. Landslide
    locations were determined from published landslide maps and coordinates, and in
    several cases the points locate the nearest town or other geographic feature. In
    all cases the locations should be considered approximate. Costly events are defined
    as those where there was public or private property damage or loss of human life.
    Landslides are defined in a broad manner, to include most types of gravitational
    mass movement such as rockfalls, debris flows, and the failure of engineered soil
    materials. Landslide causes include earthquakes, reservoir draw-downs, and heavy
    precipitation.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
